import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from './Home';
import Header from './Header';
import Checkout from './Checkout';

function App() {
  return (

      <Router>
        <div className="App">
          <Header/>
        <Switch>
          <Route path="/Checkout">

                <Checkout/>
          </Route>
        </Switch>
        <Switch>
          <Route path="/">

                <Home/>
          </Route>
        </Switch>
        </div>
      </Router>

  );
}

export default App;
